current.custom_styles:
/* # Text */
.rich-text-heading,
.alt-img-with-text--content .alt-img-with-text--text .heading {
line-height: 1.2;
}

.promo-block-grid--header { 
     font-size:  55px !important;
     width: 400px;
     line-height: 1.2;
  }

.alt-img-with-text--content .alt-img-with-text--text .preheading {
  font-family: "Lato", serif;
  font-size: 3em;
  color: #333 !important;
}

/* # Buttons -------------- */
/* ## products grid hover */
.productitem--action-trigger {
background: transparent;
color: #333333;
}

.productitem--action-trigger:hover {
color: #fff;
}

/* ## product more from brand button */
.shortcode--product-cta[button-style="primary"]:not([hidden]) {
background: #000;
border-color: #000;
color: #fff;
}

/* ## sales badge */
.productitem--badge {
border: 1px solid #333333;
}

/* # Header */
.site-header-wrapper {
box-shadow: none;
}

.site-header-main-actions {
flex-direction: row-reverse;
}

.site-header-main {
padding-top: 2em;
padding-bottom: 2em;
}

/* # Brand Store */
.brand-store-products a.shg-btn,
.shg-category a.shg-btn {
background-color: #ffffff !important;
color: #333333 !important;
border: 1px solid #333333 !important;
border-radius: 0;
}

.brand-store-products a.shg-btn:hover {
color: #ffffff !important;
}

/* insta photos plugin */
.insta-wasser {
  display: none;
}

.ssw-instagram-listing .ssw-instagram-inner {
  box-shadow: none;
}

/* # Media Style */
@media only screen and (max-width: 859px) {
    /* ## Front page rich text heading under Hero */
    #shopify-section-1589814961232 .rich-text-heading {
        font-size: 1.4rem;
    }

  .promo-block-grid--header {
     font-size: 2.5rem  !important;
  }
}

@media only screen and (min-width: 680px) {
  /* Text */
  .alt-img-with-text--content 
  .alt-img-with-text--text 
  .heading.xlarge {
     font-size: 3rem;
  }

  .alt-img-with-text--content .alt-img-with-text--text .text-content {
     font-size: 1.35rem;
  }

    /* Blog */
    .article-image {
    width: 700px;
    height: 500px;
    margin: 0 auto;
    background-position: 0;
    }
  }
